import axios from "axios";

export const url_api = 'http://localhost:5000'

export const api = {
    register: function(nombre, apellido, email, password){
        const res = axios.post(`${url_api}/register?nombre=${nombre}&apellido=${apellido}&email=${email}&password=${password}`);
        return res.data;
    }
}
